// Define your base64-encoded fonts

const customFonts = {
  BGPostanti: `data:font/ttf;base64,`,
  BGFeinen: `data:font/ttf;base64,`,
  BGSherwood: `data:font/ttf;base64,`,
  BGStone: `data:font/ttf;base64,`,
  PSTBookmani: `data:font/ttf;base64,`,
  PSTExocet: `data:font/ttf;base64,`,
  BGTooltip: `data:font/ttf;base64,`
};

// Build the font-face CSS rules dynamically
let fontFaceCSS = "";
for (const [fontName, fontData] of Object.entries(customFonts)) {
  fontFaceCSS += `
@font-face {
  font-family: '${fontName}';
  src: url(${fontData}) format('truetype');
}
`;
}

// Now combine the font CSS with your existing styles
